import React, { useState } from "react";

export const GoalList = () => {
  const [goalProgress, setGoalProgress] = useState({});
  const [goalMilestone, setMilestoneMilestone] = useState({});

  const newObject = {
    goalProgress,
    goalMilestone,
  };

  return (
    <>
      <h1>Goal List</h1>

      <fieldset>
        <div className="form-group">
          <label htmlFor="name">Goal Progress:</label>
          <input
            required
            autoFocus
            type="text"
            className="form-control"
            placeholder="Enter goal progress observations"
            onChange={(event) => {
              setGoalProgress(event.target.value);
            }}
          />
        </div>
      </fieldset>
      <fieldset>
        <div className="form-group">
          <label htmlFor="name">Goal Milestone Check:</label>
          <input
            required
            autoFocus
            type="text"
            className="form-control"
            placeholder="Enter goal progress observations"
            onChange={(event) => {
              setGoalMilestone(event.target.checked);
            }}
          />
        </div>
      </fieldset>
    </>
  );
};
